import React, { Component } from 'react';
import './Item.css';

export class Item extends Component {
	render() {
		return (
			<div className="Item">
				<div className="col-left">
				{this.props.left}
				</div>
				<div className="col-right">
				{this.props.right}
				</div>
			</div>
		)
	}
}
